import './App.css';
import Header from './views/Home';
import Hero from './components/Hero';
import Features from './components/Features';
import Schedule from './components/Schedule';

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      <Features />
      <Schedule />
    </div>
  );
}

export default App;
